import React from 'react';
import { ButtonBase, Grid, makeStyles, Paper, Typography } from '@material-ui/core';
import { Col, Row } from 'react-bootstrap';

const VolunteerInfo = (props) => {

    const useStyles = makeStyles((theme) => ({
        root: {
            flexGrow: 1,
            marginBottom: '10px'
        },
        paper: {
            padding: theme.spacing(2),
            margin: 'auto',
            maxWidth: 500,
        },
        image: {
            width: 128,
            height: 128,
        },
        img: {
            margin: 'auto',
            display: 'block',
            maxWidth: '100%',
            maxHeight: '100%',
        },
    }));

    const classes = useStyles();

    const {category,img,enterDate} = props.image //image ta age pathai ni

    return (
        <Row>
            <Col>
                <div className={classes.root}>
                    <Paper className={classes.paper}>
                        <Grid container spacing={2}>
                            <Grid item>
                                <ButtonBase className={classes.image}>
                                    <img className={classes.img} alt="complex" src={img} />
                                </ButtonBase>
                            </Grid>
                            <Grid item xs={12} sm container>
                                <Grid item xs container direction="column" spacing={2}>
                                    <Grid item xs>
                                        <Typography gutterBottom variant="subtitle1">
                                            {category}
                                        </Typography>
                                        <Typography variant="body2" gutterBottom>
                                        {(new Date(enterDate.checkIn).toString('dd/MM/yyyy') )}
                                        </Typography>

                                    </Grid>

                                </Grid>

                            </Grid>
                        </Grid>
                    </Paper>
                </div>
            </Col>



            <Col>

            </Col>
        </Row>
    );
};

export default VolunteerInfo;
